import React from 'react'
import { Link } from 'react-router-dom'
import {UserRound} from 'lucide-react';
function SideNav() {
  return (
    <div className='bg-bgBlue h-screen w-fit p-20 flex flex-col text-textColor1 text-lg'>
        <div>
            <Link to='/s' className='flex flex-row gap-2 bg-white text-black p-2 rounded-3xl'><UserRound /> Student</Link>
        </div>
    </div>
  )
}

export default SideNav
